import React from "react";
import "./index.scss";

import ChartSolides from "../../../../../components/charts";

const MiddleRequirements = ({ texts, data }) => {
    return (
        <div className="middle-requirements-noAuth">
            <h2>ExigÃªncia do meio e flexibilidade</h2>
            <p className="desc-profiler">{texts.ambiente_trabalho.texto}</p>
            <div>
                <ChartSolides
                    type="mediumRequirement"
                    mediumRequirement={{
                        voce: {
                            executor: data[0].data[0].toFixed(2) + "%",
                            planejador: data[0].data[1].toFixed(2) + "%",
                            comunicador: data[0].data[2].toFixed(2) + "%",
                            analista: data[0].data[3].toFixed(2) + "%"
                        },
                        meio: {
                            executor: data[1].data[0].toFixed(2) + "%",
                            planejador: data[1].data[1].toFixed(2) + "%",
                            comunicador: data[1].data[2].toFixed(2) + "%",
                            analista: data[1].data[3].toFixed(2) + "%"
                        },
                        flexibilidade: {
                            executor: data[2].data[0].toFixed(2) + "%",
                            planejador: data[2].data[1].toFixed(2) + "%",
                            comunicador: data[2].data[2].toFixed(2) + "%",
                            analista: data[2].data[3].toFixed(2) + "%"
                        }
                    }}
                />
            </div>
        </div>
    );
};

export default MiddleRequirements;
